import Search from '/search';
const SideBar = props => (
  <div>
    <div className="sideBarBox">
        <h3> SIDEBAR</h3>
        <Search></Search>
    </div>

    <style jsx>{`
    padding: 0;
    margin: 0;
    height: 100vh;
    color: #1DB954;
    background: black;
    `}
    </style>
  </div>
);

export default SideBar;
